import React from 'react'
import './Home.css'
import Product from "./Product"

function Home() {
  return (
    <div className='home'>
        <div className="home__box">
          <Product title="" 
          price={10} 
          image="" 
          rating={4,5}/>          
        </div>

    </div>
  )
}

export default Home
